// CreateDoctorScheduleForm.js
import React, { useState } from 'react';

const CreateDoctorScheduleForm = ({ onCreateSchedule }) => {
  const [date, setDate] = useState('');
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validate the form data (add your validation logic here)

    // Create a DTO object to send to the backend
    const scheduleData = {
      Date_DateOnly: date,
      StartTime_TimeOnly: startTime,
      EndTime_TimeOnly: endTime,
    };

    // Call the callback function to handle the schedule creation
    onCreateSchedule(scheduleData);

    // Clear the form fields
    setDate('');
    setStartTime('');
    setEndTime('');
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>Date:</label>
      <input
        type="date"
        value={date}
        onChange={(e) => setDate(e.target.value)}
        required
      />
      <br />

      <label>Start Time:</label>
      <input
        type="time"
        value={startTime}
        onChange={(e) => setStartTime(e.target.value)}
        required
      />
      <br />

      <label>End Time:</label>
      <input
        type="time"
        value={endTime}
        onChange={(e) => setEndTime(e.target.value)}
        required
      />
      <br />

      <button type="submit">Create Schedule</button>
    </form>
  );
};

export default CreateDoctorScheduleForm;
